import logo from './logo.svg';
import './App.css';

import {
  Router,
  Routers
} from 'react-dom'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>You've come to the right place! It's just...</p>
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Under construction using <code>React.js</code>
        </p>
        <a
          className="my-resume"
          href={process.env.PUBLIC_URL + "/assets/files/Resume.pdf"}
          target="_self"
          rel="noopener noreferrer"
        >
          My Resume
        </a>
      </header>
    </div>
  );
}

export default App;

// To serve from public
